import React, { useState } from 'react';
import '../styles/TableStyles.css';

function Table() {
  const [formValues, setFormValues] = useState({
    column1: '',
    column2: '',
    column3: '',
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleCancelClick = () => {
    setFormValues({
      column1: '',
      column2: '',
      column3: '',
    });
  };

  const [tableData, setTableData] = useState([
    {
      column1: 'Column 1, Row 1',
      column2: 'Column 2, Row 1',
      column3: 'Column 3, Row 1',
    },
    {
      column1: 'Column 1, Row 2',
      column2: 'Column 2, Row 2',
      column3: 'Column 3, Row 2',
    },
    {
      column1: 'Column 1, Row 3',
      column2: 'Column 2, Row 3',
      column3: 'Column 3, Row 3',
    },
  ]);

  const handleSaveClick = () => {
    setTableData([...tableData, formValues]);
    handleCancelClick();
  };

  return (
    <div className="table-container">
      <div className="table">
        <h2>Table</h2>
        <table>
          <tr>
            <th>Column 1</th>
            <th>Column 2</th>
            <th>Column 3</th>
          </tr>
          <tr>
            <td>Column 1, Row 1</td>
            <td>Column 2, Row 1</td>
            <td>Column 3, Row 1</td>
          </tr>
          <tr>
            <td>Column 1, Row 2</td>
            <td>Column 2, Row 2</td>
            <td>Column 3, Row 2</td>
          </tr>
          <tr>
            <td>Column 1, Row 3</td>
            <td>Column 2, Row 3</td>
            <td>Column 3, Row 3</td>
          </tr>
        </table>
      </div>

      <button>Add New Item</button>

      <div className="ani-form">
        <h2>Form</h2>
        <div className="inputs">
          <div className="input">
            <label>Input - Column 1</label>
            <input
              type="text"
              name="column1"
              value={formValues.column1}
              onChange={handleInputChange}
            />
          </div>
          <div className="input">
            <label>Input - Column 2</label>
            <input
              type="number"
              name="column2"
              value={formValues.column2}
              onChange={handleInputChange}
            />
          </div>
          <div className="input">
            <label>Input - Column 3</label>
            <input
              type="text"
              name="column3"
              value={formValues.column3}
              onChange={handleInputChange}
            />
          </div>
        </div>
        <div className="buttons">
          <div className="button">
            <button onClick={handleCancelClick}>Cancel</button>
          </div>
          <div className="button">
            <button onClick={handleSaveClick}>Save</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Table;
